import axios from 'axios';

const API_BASE_URL = 'http://localhost:8080/api/v1/courses';

const CourseService = {
  getAllCourses: () => axios.get(API_BASE_URL),
  getCourseById: (id) => axios.get(`${API_BASE_URL}/${id}`),
  createCourse: (course) => axios.post(API_BASE_URL, course),
  updateCourse: (id, course) => axios.put(`${API_BASE_URL}/${id}`, course),
  deleteCourse: (id) => axios.delete(`${API_BASE_URL}/${id}`),
};

export default CourseService;
